import math
def is_prime(x):
    if x < 2:
        return False
    for i in range(2, int(math.sqrt(x)) + 1):
        if x % i == 0:
            return False
    return True
def is_prime_row(matrix):
    for row in matrix:
        if all(is_prime(x) for x in row):
            return True
    return False
def is_prime_col(matrix):
    for col in range(len(matrix[0])):
        if all(is_prime(x) for x in (row[col] for row in matrix)):
            return True
    return False
def is_prime_matrix(matrix):
    return is_prime_row(matrix) or is_prime_col(matrix)
def get_moves(matrix):
    if is_prime_matrix(matrix):
        return 0
    moves = 0
    for row in matrix:
        for x in row:
            if not is_prime(x):
                moves += x - 1
    return moves

