from math import factorial
def fact_mod(n, p):
    if n == 0:
        return 1
    return (n * fact_mod(n - 1, p)) % p
def ncr_mod(n, r, p):
    return (fact_mod(n, p) * fact_mod(r, p) * fact_mod(n - r, p)) % p
def solve(n, k):
    p = 1000003
    if k > 2**n:
        return 0
    if k == 2**n:
        return 1
    return (ncr_mod(2**n, k, p) - ncr_mod(2**n - 1, k, p)) % p
def main():
    n, k = [int(x) for x in input().split()]
    print(solve(n, k))
