def mario_game(word):
    if len(word) == 1:
        return word
    elif len(word) == 2:
        return word[1] + word[0]
    else:
        mid = len(word) // 2
        first_half = word[:mid][::-1]
        second_half = word[mid:][::-1]
        return min(first_half + second_half, second_half + first_half)

