    if len(t) == 0:
        return 0
    if len(t) == 1:
        return 0
    if t[0] == s[0]:
        return cut(s[1:], t[1:])
    if t[0] == t[-1]:
        return cut(s, t[1:-1]) + cut(s, t[:-1])
    if t[1] == t[-1]:
        return cut(s, t[1:-1]) + cut(s, t[:-1])
    return cut(s, t[1:]) + cut(s, t[:-1])

