class Graph:
    def __init__(self, n):
        self.n = n
        self.g = [[] for _ in range(n)]
        self.d = [0 for _ in range(n)]
    def add_edge(self, u, v):
        self.g[u].append(v)
        self.g[v].append(u)
        self.d[u] += 1
        self.d[v] += 1
    def dfs(self, u, p):
        if self.d[u] == 1:
            return True
        for v in self.g[u]:
            if v == p:
                continue
            if not self.dfs(v, u):
                return False
        return True
    def is_tree(self):
        for i in range(self.n):
            if self.d[i] != 1:
                return False
        return self.dfs(0, -1)
def main():
    n = int(input())
    g = Graph(n)
    for i in range(n):
        l, r = [int(x) for x in input().split()]
        l -= 1
        r -= 1
        if l > r:
            l, r = r, l
        g.add_edge(l, r)
    print("YES" if g.is_tree() else "NO")
main()

