def longest_non_palindrome(s):
    if len(s) < 2:
        return 0
    if s[0] != s[1]:
        return 2
    l = 2
    r = 2
    while r < len(s) - 1:
        if s[r] != s[r+1]:
            return r - l + 1
        r += 1
    return 0

