from datetime import datetime, timedelta

def flash_time(t):
    return datetime.strptime(t, '%H:%M')

def next_flash(t, d):
    return (flash_time(t) + timedelta(minutes=d)).time()

def same_minute(t1, t2):
    return (t1.hour, t1.minute) == (t2.hour, t2.minute)

def main():
    t1 = flash_time(input())
    t2 = flash_time(input())
    d1 = int(input())
    d2 = int(input())
    t1_next = next_flash(t1, d1)
    t2_next = next_flash(t2, d2)
    while not same_minute(t1_next, t2_next):
        t1_next = next_flash(t1_next, d1)
        t2_next = next_flash(t2_next, d2)
    print(datetime.strftime(t1_next, '%A').capitalize())
    print(datetime.strftime(t1_next, '%H:%M').capitalize())

if __name__ == '__main__':
    main()

