import math
def distance(p1, p2):
    return math.sqrt((p1[0]-p2[0])**2 + (p1[1]-p2[1])**2)
def touch_distance(p1, p2):
    return distance(p1, p1[0])
def touch_vector(p1, p2):
    return (p2[0]-p1[0], p2[1]-p1[1])
def touch_angle(p1, p2):
    v = touch_vector(p1, p2)
    return math.atan2(v[1], v[0])
def touch_rotation(p1, p2):
    return touch_angle(p1, p2) - touch_angle(p1[0], p1)
def grip_distance(p1, p2):
    return sum(touch_distance(p1, p2) for p1 in p2) / len(p2)
def grip_rotation(p1, p2):
    return sum(touch_rotation(p1, p2) for p1 in p2) / len(p2)
def grip_vector(p1, p2):
    return (sum(p1[0] for p1 in p2) / len(p2), sum(p1[1] for p1 in p2) / len(p2))
def grip_angle(p1, p2):
    v = grip_vector(p1, p2)
    return math.atan2(v[1], v[0])
def grip_rotation_distance(p1, p2):
    return grip_rotation(p1, p2) * grip_distance(p1, p2)
def distance_between_grips(p1, p2):
    return grip_rotation_distance(p1, p2)
def classify_gesture(p1, p2):
    d = distance_between_grips(p1, p2)
    if d < 0.01:
        return 'pan'
    elif d < 0.1:
        return 'zoom'
    else:
        return 'rotate'
def rotate_direction(p1, p2):
    v = grip_vector(p1, p2)
    if v[1] > 0:
        return 'clockwise'
    else:
        return 'counter-clockwise'
def classify(p1, p2):
    return (len(p1), classify_gesture(p1, p2), rotate_direction(p1, p2))

