def sieve(n):
    prime = [True for i in range(n+1)]
    p = 2
    while (p * p <= n):
        if (prime[p] == True):
            for i in range(p * 2, n+1, p):
                prime[i] = False
        p += 1
    prime[0]= False
    prime[1]= False
    return prime
def find_kth_prime(n, k):
    # your code here
    prime = sieve(n)
    count = 0
    for i in range(2, n):
        if prime[i]:
            count += 1
            if count == k:
                return i
    return -1

