def is_valid(s, p):
    if s == p:
        return True
    if s[0] == p[0]:
        return is_valid(s[1:], p)
    if s[-1] == p[-1]:
        return is_valid(s[:-1], p[:-1])
    return is_valid(s, p[1:]) or is_valid(s[:-1], p) or is_valid(s, p[:-1]) or is_valid(s, p[1:-1]).lower() == p.lower()

def max_consecutive_rainy_days(records):
    max_rainy_days = 0
    current_rainy_days = 0
    for record in records:
        if record == 'R':
            current_rainy_days += 1
            max_rainy_days = max(max_rainy_days, current_rainy_days)
        else:
            current_rainy_days = 0
    return max_rainy_days

